import React from "react";

function AuthForm({title, button}) {

  const navigate = useNavigate();

  return (
    <div className="auth">
      <button className="back-button"></button>
      <h1 className="auth__title">{title}</h1>
      <form
        className="auth__form"
        name={`auth-form`}
      >
        <input
          className={`auth__input`}
          type="email"
          placeholder="Email"
          name="email"
          required
        />
        <input
          className={`auth__input`}
          type="password"
          placeholder="Пароль"
          name="password"
          minLength="3"
          required
        />
        <button
          type="submit"
          className={`button wellcome__button`}
        >
          {button}
        </button>
      </form>
    </div>
  );
}

export default AuthForm;
